import React from 'react';
import {useContext,useEffect} from 'react';
import { Layout } from '../components/commons/Layout';
import {NewsletterContextProvider,NewsletterContext} from '../contexts/newsletterContext';
export const Stadistics = () => {
    const { getStadistics,stadisticsList} = useContext ( NewsletterContext );
    useEffect(() => {
        getStadistics();
      }, []);
      
   
  return (
    <div>
      {
        stadisticsList.map((index) => (
        
            <div className="form-check"  key={index[0]}>
              <input
              
                className="form-check-input"
                type="checkbox"
                value={index[0]}
                id="flexCheckDefault"
              />
              <label  className="form-check-label" htmlFor="flexCheckDefault">
                {index[0]}
              </label>
            </div>
          
        ))        
        }
    </div>
  )
}
